const useStyles = makeStyles((theme)=>({
  root:{
    backgroundColor:"#303030",
    height:"100%",
    minHeight:"100vh",
    width:"99%"
  }
}))

    

export default function Home(param){
  const classes = useStyles()
  const auth = useContext(AuthContext)

